Musée de l'Histoire de France may refer to:the Musée de l'Histoire de France (Versailles), created by Louis-Philippe I in 1837;
the Musée des Archives Nationales, also known as musée de l'Histoire de France between 1939 and 2006;
the Maison de l'Histoire de France, a stillborn museum project promoted by French President Nicolas Sarkozy and canceled by his successor François Hollande.
